      <div className="row justify-content-center">
          {/* <div className=""> */}
        <FadeIn classNam='col-6 main-frame shadow rounded'>
            Nội dung của thẻ div C
        </FadeIn>
          {/* </div> */}
      </div>
    </div>
  )
}
